import React, { Component } from "react";

class Users extends Component {
  state = {
    users: [
      {
        id: 10939256,
        login: "eder13",
        avatar_url: "https://avatars1.githubusercontent.com/u/10939256?v=4",
        html_url: "https://github.com/eder13",
      },
      {
        id: 2149883,
        login: "majodev",
        avatar_url: "https://avatars1.githubusercontent.com/u/2149883?v=4",
        html_url: "https://github.com/majodev",
      },
      {
        id: 1721978,
        login: "lol",
        avatar_url: "https://avatars0.githubusercontent.com/u/1721978?v=4",
        html_url: "https://github.com/lol",
      },
    ],
  };

  render() {
    return (
      <div>
        {this.state.users.map((user) => {
          return <div>{user.login}</div>;
        })}
      </div>
    );
  }
}

export default Users;
